import {DALLE2_HOST} from '@/constant'

const url = `${DALLE2_HOST}/generate`

export const generate = async (prompt, generateNumber) => {
    // return [
    //         "",
    //         ""
    //     ]
    try {
        const response = await fetch(url, {
            method: 'POST',
            body: JSON.stringify({
                text: prompt,
                num_images: generateNumber
            })
        })
        const result = await response.json()
        return result['generatedImgs']
    } catch (error) {
        console.error(`dalle2 generate error. param: prompt: ${prompt}, generateNumber: ${generateNumber}. error: ${error}`)
        throw error
    }
}
